import React from "react";
import { cardsData } from "../../../data/cardsData";
import LinkCard from "../../components/LinkCard";
// import  "./styles.css";

function Cards() {

  return (

    <div class="cardsContainer">
        {cardsData.map((elem) => (
          <LinkCard
            id={elem.id}
            image={elem.image}
            title={elem.title}
          />
        ))}
      </div>
  );
}
export default Cards;
